  false,\n\t\"url\": null,\n\t\"notes\": \"The Hawaii Coastal Use Mapping Project
  is an innovative partnership between NOAA's National Marine Protected Areas Center,
  NOAA's Pacific Islands Fisheries Science Center, NOAA's Pacific Islands Regional
  Office, and the Hawaii Division of Aquatic Resources. The West Maui Coastal use
  Participatory Mapping Project was developed through a partnership between the Hawaii
  State Division of Aquatic Resources (HDAR), NOAA's Pacific Islands Regional Office
  (PIRO), NOAA Coral Reef Conservation Program (CRCP) and NOAA's Ocean Service, Office
  for Coastal Management - Pacific Islands (OCM). These projects were designed to
  enhance ocean management by gathering geospatial data on human uses of the nearshore
  ocean environments of the Kawaihae-Keahole and Honolua-Wahikuli regions of Hawaii.
  The data were gathered from regional ocean experts and users through participatory
  GIS methods. For more information on the project scope, background and related data
  products, please visit http://marinecadastre.gov/oceanuses/, http://marineprotectedareas.noaa.gov/dataanalysis/hi_coastal_use/,
  or http://planning.hawaii.gov/gis/west-maui-coastal-uses-participatory-mapping-project/.\",\n\t\"owner_org\":
